	add("section", "{\"term\":\"section\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"{{PIE root|en|sek}}From Old french (842-ca. 1400) from Latin \u0027sectio\u0027 (cutting, cutting off, excision, amputation of diseased parts of the body, etc.) from \u0027sectus\u0027 past participle of \u0027lang\u003dla|secare\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A cutting; a part cut out from the rest of something\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A part, piece, subdivision of anything\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"issue\u003d3|page\u003d21|magazine\u003d|title\u003d[http://www.guardian.co.uk/commentisfree/joris-luyendijk-banking-blog/2013/jun/19/banking-britain-beyond-control Our banks are out of passage\u003dSeeing the British establishment struggle with the financial sector is like watching an alcoholic […].  Until 2008 there was denial over what finance had become. […]  But the scandals kept coming, and so we entered stage three – what therapists call \u0026quot;bargaining\u0026quot;. A broad \u0027\u0027section\u0027\u0027 of the political class now recognises the need for change but remains unable to see the necessity of a fundamental overhaul. Instead it offers fixes and patches\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A part of a document\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"An act or instance of cutting\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A cross-section (image that shows an object as if cut along a plane\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A cross-section perpendicular the longitudinal axis of an aircraft in flight\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"An incision or the act of making an incision\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A thin slice of material prepared as a specimen for research\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A taxonomic rank below the genus (and subgenus if present), but above the species\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"An informal taxonomic rank below the order ranks and above the family ranks\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A group of 10-15 soldiers lead by a non-commissioned officer and forming part of a platoon\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"A right inverse\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"A piece of residential land; a plot\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"A one-mile square area of land, defined by a government survey\", \"priority\":15}]}, \"synonyms\":{}}");

