	add("security", "{\"term\":\"security\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) \u0027securite\u0027, from Old french (842-ca. 1400) (French: {{m|fr|sécurité}}), from Latin \u0027securitas\u0027, from Latin \u0027securus\u0027 \u0026quot;safe, secure\u0026quot;, from {{affix|la|se-|gloss1\u003dwithout|cura|gloss2\u003dcare|nocat\u003d1}}; see cure. Similar to Latin {{m|la|sine cura||without care, carefree}}, which led to English {{m|en|sinecure}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The condition of not being threatened, especially physically, psychologically, emotionally, or financially\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Give up yourself merely to chance and hazard, / From firm \u0027\u0027security\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Jonathan Swif\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Some alleged that we should have no \u0027\u0027security\u0027\u0027 for our trade\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Something that secures\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"An organization or department responsible for providing security by enforcing laws, rules, and regulations as well as maintaining order\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.guardian.co.uk/commentisfree/2012/dec/14/north-korea-boys-toys-threat-reaction We mustn\u0027t overreact to North Korea boys\u0027 passage\u003dThe threat of terrorism to the British lies in the overreaction to it of British governments. Each one in turn clicks up the ratchet of surveillance, intrusion and \u0027\u0027security\u0027\u0027. Each one diminishes liberty\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/international/21579039-chinas-growing-empire-ports-abroad-mainly-about-trade-not-aggression-new-masters The new masters and passage\u003dFrom the ground, Colombo’s port does not look like much. Those entering it are greeted by wire fences, walls dating back to colonial times and \u0027\u0027security\u0027\u0027 posts. For mariners leaving the port after lonely nights on the high seas, the delights of the B52 Night Club and Stallion Pub lie a stumble away\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Something that secures the fulfillment of an obligation or law\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Freedom from apprehension\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Proof of ownership of stocks, bonds or other investment instruments.\u0026lt;sup\u0026gt;W:Security W\u0026lt;/sup\u0026gt\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Property etc. temporarily relinquished to guarantee repayment of a loan\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"A guarantee\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"Macaula\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"Those who lent him money lent it on no \u0027\u0027security\u0027\u0027 but his bare word\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"Carelessness; negligence\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"He means, my lord, that we are too remiss, / Whilst Bolingbroke, through our \u0027\u0027security\u0027\u0027, / Grows strong and great in substance and in power\", \"priority\":19}]}, \"synonyms\":{}}");

